import React from "react";
import Link from "@mui/material/Link";
import { HomeNavbar } from "../components";
import HeaderImage from "../assets/header-img.jpg";
import {
  AppBar,
  Toolbar,
  Card,
  CardActionArea,
  CardContent,
  Grid,
  Typography,
  makeStyles,
} from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
}));

function Copyright(props) {
  return (
    <Typography
      variant="body2"
      color="text.secondary"
      align="center"
      {...props}
    >
      {"Copyright © "}
      {new Date().getFullYear()}
      {"."}
      <Link color="inherit" href="https://ipo.rutgers.edu/">
        Rutgers, The State University of New Jersey. All rights reserved.
      </Link>{" "}
    </Typography>
  );
}

export default function Tab1() {
  const classes = useStyles();

  return (
    <div>
      <div className={classes.root}>
        <HomeNavbar />
        <>
        <div className={classes.root}>
        <Grid container spacing={3}>
          <Grid item xs={12}>
            <Typography className={classes.paperTitle}>
              Welcome to the IP&O App
            </Typography>
            <img
              src={HeaderImage}
              className={classes.headerImg}
              alt="superHeroImage"
            />
          </Grid>
          <Grid item xs={6} className={classes.card}>
            <Card className={classes.cardInfo}>
              <CardActionArea>
                <CardContent className={classes.cardContent}>
                  <Typography gutterBottom variant="h5" component="h2">
                    Customer Form
                  </Typography>
                  <Typography
                    variant="body2"
                    color="textSecondary"
                    component="p"
                  >
                    Add your information to become a superhero!
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </Grid>
          <Grid item xs={6} className={classes.card}>
            <Card className={classes.cardInfo}>
              <CardActionArea>
                <CardContent>
                  <Typography gutterBottom variant="h5" component="h2">
                    Hero Form
                  </Typography>
                  <Typography
                    variant="body2"
                    color="textSecondary"
                    component="p"
                  >
                    View hero squad details and select super heroes!
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </Grid>
        </Grid>
      </div>
        </>
      </div>
      <Copyright sx={{ mt: 8, mb: 4 }} />
    </div>
  );
}
